import React, {Component} from 'react';
import Counter from './Counter';

class Review extends Component {
  render() {
    return (
      <div className="Review">
      <a href={this.props.link}> <h2 className='ReviewTitle'>{this.props.title}</h2>
      <p>{this.props.body}</p>
      </a>
      <div className='ReviewCommentsAndLikes'><p>{this.props.comments} comments</p> <Counter likes={this.props.likes} /></div>
      </div>
    )
  }
}

export default Review
